import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0202002 from '../../include/Pop_C0202002';
import Pop_C0202005 from '../../include/Pop_C0202005';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm01'}
                                name={'sm01'}
                                label={'제품배치번호'}
                                
                            />
                            <OwpSearchDateTimePickerMulti
                                name="sm02"
                                initNow={true} // TODO: true 인 경우 현재 시로 init (* default = false)
                                labels={{ start: ' 배치발행시작', end: '종료일' }}
                                inputProps={{ start: { style: { width: 140 } }, end: { style: { width: 140 } } }}
                                required={true}
                            />

                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm03'}
                                name={'sm03'}
                                label={'제품명'}
                                
                            />

                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm04'}
                                name={'sm04'}
                                label={'제품ID번호'}
                                
                            />
                            
                            <OwpSearchSelectField
                                className="w-160"
                                id={'sm05'}
                                name={'sm05'}
                                label="진행현황"
                                useAll
                            />

                            {/*Hidden 필수 값*/}
                            {/* <OwpSearchTextField
                                className="hidden"
                                name="OWP_PRODPLAN.PLAN_TYPE"
                                value="D006002"
                            /> */}
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="제조지시 조회">
                            <Pop_C0202002/>
                            <OwpButton color={'secondary'} variant={'contained'}>
                                COPY
                            </OwpButton>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            수정
                            </OwpButton>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            삭제
                            </OwpButton>
                            <Pop_C0202005/>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0202000"
                                LayoutUrl={'/assets/data/C0202000Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
